import React from 'react'

export default function Ingredients(props) {
    let ingredients= props.ingredients.name.map((f,i) => {
        return <li key={i}>{f.name}</li>
    })

    console.log(props.ingredients)
    return (
        <>
        <ul>{ingredients}</ul>
        </>
    )

}
